import { FormControl, Validators } from "@angular/forms";

export class Cliente{

    id:number=0;
    nombre:string='';
    apellido:string='';
    email:string='';
    createAt:string | undefined;

    constructor(id: number, nombre: string, apellido: string, email: string, createAt: string) {
        this.id = id;
        this.nombre = nombre;
        this.apellido = apellido;
        this.email = email;
      }

      
}
